import React, { useState, useEffect } from 'react';
import OfferComponent from './OfferComponent'; // Import OfferComponent

const DataFetchingComponent = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {

        const cachedData = localStorage.getItem('cachedData');
        if (cachedData) {
          setData(JSON.parse(cachedData));
        } else {
          // Fetch data from server if not cached
          const response = await fetch('https://api.adkey-seo.com/api/website/get-website/295');
          if (!response.ok) {
            throw new Error('Failed to fetch data');
          }
          const responseData = await response.json();

          localStorage.setItem('cachedData', JSON.stringify(responseData));
          setData(responseData);
        }
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []); 

  return (
    <div>
      {data ? (
        <OfferComponent offers={data.offers} />
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default DataFetchingComponent;
